const lowered = blockedWords.map(w => (w || '').toLowerCase());
const encoded = lowered.map(w => encodeURIComponent(w));
const patterns = Array.from(new Set(lowered.concat(encoded)));

function isBlocked(q) {
  const s = (q || '').toLowerCase();
  return patterns.some(p => p && s.includes(p));
}

function safeDecodeParam(raw) {
  if (!raw) return '';
  try {
    // + в query часто означает пробел в form-encoding
    return decodeURIComponent(raw.replace(/\+/g, ' '));
  } catch (e) {
    return raw.replace(/\+/g, ' ');
  }
}

function getSearchValuesFromUrl(urlStr) {
  try {
    const u = new URL(urlStr);
    const keys = ['q', 'text', 'query', 'search', 'p', 'wd', 'w']; // часто используемые
    const out = [];
    for (const k of keys) {
      const v = u.searchParams.get(k);
      if (v) out.push(safeDecodeParam(v));
    }
    // также добавим все query-параметры на всякий случай
    // (если выше ничего не нашлось, проверим все params)
    if (out.length === 0) {
      for (const [k, v] of u.searchParams.entries()) {
        if (v) out.push(safeDecodeParam(v));
      }
    }
    return out;
  } catch (e) {
    return [];
  }
}

function goToWarning(query) {
  const tryExtUrl = () => {
    try {
      if (typeof chrome !== 'undefined' && chrome.runtime && chrome.runtime.getURL) {
        return chrome.runtime.getURL('warning.html') + '?q=' + encodeURIComponent(query || '');
      }
    } catch (_) {}
    return null;
  };

  const extUrl = tryExtUrl();
  if (extUrl) {
    try {
      // Пытаемся заменить верхний фрейм (на случай, если мы внутри iframe)
      window.top.location.replace(extUrl);
    } catch (e) {
      // fallback
      window.location.replace(extUrl);
    }
  } else {
    // Резервный data:URL (если chrome.runtime недоступен)
    const html = `
      <!doctype html><meta charset="utf-8">
      <title>Запрос заблокирован</title>
      <style>
        *{box-sizing:border-box}body{margin:0;min-height:100vh;display:grid;place-items:center;
        background:#f44336;color:#fff;font-family:system-ui,-apple-system,"Segoe UI",Roboto,Arial,sans-serif}
        .box{background:rgba(0,0,0,.55);padding:28px;border-radius:14px;width:min(560px,92vw);text-align:center}
        .q{margin-top:8px;font-weight:700}
        a.btn{display:inline-block;margin-top:16px;padding:10px 16px;border-radius:10px;background:#fff;color:#f44336;
        text-decoration:none;font-weight:700}
      </style>
      <div class="box">
        <h1>🚫 Запрос заблокирован</h1>
        <p>Ваш запрос содержит запрещённое слово.</p>
        <p class="q">${(query || '').replace(/[<&>]/g, s=>({ '<':'&lt;','>':'&gt;','&':'&amp;' }[s]))}</p>
        <a class="btn" href="https://www.google.com">Вернуться в поиск</a>
      </div>`;
    const dataUrl = 'data:text/html;charset=utf-8,' + encodeURIComponent(html);
    try {
      window.top.location.replace(dataUrl);
    } catch (e) {
      window.location.replace(dataUrl);
    }
  }
}

// Проверка URL-строки на запрещённые слова
function checkUrlAndBlock(urlStr) {
  const vals = getSearchValuesFromUrl(urlStr);
  for (const v of vals) {
    if (v && isBlocked(v)) {
      goToWarning(v);
      return true;
    }
  }
  return false;
}

// ——— initial check (document_start)
try {
  checkUrlAndBlock(location.href);
} catch (e) {
  // ignore
}

// ——— Отслеживаем изменения истории (pushState/replaceState + popstate)
// Это ловит SPA/instant-search, когда URL меняется без полной перезагрузки.
(function() {
  const _push = history.pushState;
  const _replace = history.replaceState;
  history.pushState = function() {
    _push.apply(this, arguments);
    window.dispatchEvent(new Event('locationchange'));
  };
  history.replaceState = function() {
    _replace.apply(this, arguments);
    window.dispatchEvent(new Event('locationchange'));
  };
  window.addEventListener('popstate', () => window.dispatchEvent(new Event('locationchange')));
  window.addEventListener('locationchange', () => {
    try {
      checkUrlAndBlock(location.href);
    } catch (e) {}
  });
})();

// ——— Перехват отправки форм (поиск на сайте)
document.addEventListener('submit', (e) => {
  try {
    const form = e.target;
    const input = form && form.querySelector("input[type='text'], input[type='search'], textarea");
    if (!input) return;
    const q = input.value || '';
    if (isBlocked(q)) {
      e.preventDefault();
      e.stopPropagation();
      e.stopImmediatePropagation && e.stopImmediatePropagation();
      goToWarning(q);
    }
  } catch (err) {}
}, true);

// ——— Перехват Enter (instant search / нажатие Enter в поле)
document.addEventListener('keydown', (e) => {
  try {
    if (e.key !== 'Enter') return;
    const el = document.activeElement;
    if (!el || (el.tagName !== 'INPUT' && el.tagName !== 'TEXTAREA')) return;
    const q = el.value || '';
    if (isBlocked(q)) {
      e.preventDefault();
      e.stopPropagation();
      e.stopImmediatePropagation && e.stopImmediatePropagation();
      goToWarning(q);
    }
  } catch (err) {}
}, true);

// Лёгкая диагностика
console.log('✅ Content script loaded. Patterns:', patterns.length);
